function getNext(arr, start) {
	const tmp = arr[start] - 1;
	let result;

	do {
		result = arr[++start];
	} while ((result != tmp) && start < arr.length);

	return start;
}

function stringsInMaxDepth(s) {
	if(!s) return [''];

	let tmp = 0;
	let max = -1;
	const level = new Array(s.length).fill(-1);
	const result = [];

	s.split('').forEach((ele, index) => {
		if (ele == "(") {
			tmp++;
			level[index] = tmp;

			if (tmp > max) {
				max = tmp;
			}
		} else if (ele == ")") {
			tmp--;
			level[index] = tmp;
		}
	});

	if (max <= 0) return [s];

	level.forEach((ele, index) => {
		if (ele == max) {
			result.push(s.substring(index + 1, getNext(level, index)));
		}
	})

	return result;
}

